  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA's Undersea Research Center for the
  NOAA's Undersea Research Center for the North Atlantic and Great Lakes region (NAGL)
  explores and studies the waters off the northeast coast of the United States (i.e.,
  Gulf of Maine, Georges Bank and the Southern New England Bight including Long Island
  Sound) and the Laurentian Great Lakes. Underwater diving technologies available
  through the Center include occupied submersibles, remotely operated vehicles (ROV's),
  and Nitrox scuba. NURC-NAGL specializes in development of sampling technologies
  that increase the utility of submersible vehicles, in particular, remotely operated
  vehicle (ROV) systems.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
